sessions.session_desc:
Experience the thrill of racing on one of the world’s most iconic race courses with the iRacing Nurburgring Endurance Series. Take the wheel in one of five classes—GT3, GT4, Porsche Cup, Touring Car, and BMW M2 —in some of our most popular sports cars in a series of endurance events. Whether you’re sharing the cockpit with your teammates or trying to conquer the track on your own, this multi-class event offers one of the most unique challenges that a sports car racer could ask for. 

 {/br}{/br} 

 Session dates/times: Saturday 7:00/17:00 GMT, Sunday 0:00/13:00 GMT
